import React from "react";
import { Link } from "react-router-dom";

const Sidebar = () => {
  return (
    <div
      className="d-inline-block"
      style={{ width: "15vw", height: "100vh", backgroundColor: "#D3E0EA" }}
    >
      <ul style={{ listStyle: "none" }}>
        <li className="text-muted mx-auto my-4">
          <Link to="">Home</Link>
        </li>
        <li className="text-muted mx-auto my-4">
          <Link className="text-decoration-none" to="">
            Transacciones
          </Link>
        </li>
        <li className="text-muted text-decoration-none mx-auto my-4">
          <Link to="">Historial</Link>
        </li>
      </ul>
    </div>
  );
};

export default Sidebar;
